import React, { useContext } from 'react';
import { globalContext } from './App';

function Profile() {
    const {globalUserObject, setGlobalUserObject} = useContext(globalContext);

    return (
        <div style={{ margin: 'auto', width: 500, border: "1px solid black", padding: 30, paddingTop: 20, borderRadius: 10 }}>
            <h1>Profile</h1>
            <p>Email: {globalUserObject.email}</p>
            <p>College ID: {globalUserObject.collegeId}</p>
            <p>Branch: {globalUserObject.branch}</p>
            <p>Gender: {globalUserObject.gender}</p>
            <h1>Profile</h1>
            <p>Your details</p>
            <label>College ID</label>
            <p>{globalUserObject.collegeId}</p>
            <label>Password</label>
            <p>{globalUserObject.password}</p>
            <label>Email address</label>
            <p>{globalUserObject.email}</p>
            <label>Branch</label>
            <p>{globalUserObject.branch}</p>
        </div>
    );
}

export default Profile;
